import React from "react";

function Aboutpage() {
  return (
    <>
      <div className="first-about">
        <div className="about-main-container">
          <div className="about-upper"></div>
          <div className="about-lower"></div>
        </div>
      </div>
    </>
  );
}

export default Aboutpage;
